import React from 'react'
import styled from 'styled-components';

const Title = styled.div`
    display:flex;
    width: 100%;
    height: auto;
    justify-content:center;
    text-align:center;
    font-size: 1.4rem;
    font-weight: 600;
`

const Box = styled.div`
    margin: 80px auto;
    padding: 40px 0;
    display:flex;
    flex-direction: column;
    justify-content: center;
    text-align: center;
    width: 80%;
    height: auto;
    border: 3px solid black;
    border-radius: 12px;

    font-size: 1.4rem;
    font-weight: 600;
`

const Container = ({ children }) => {
  return (
    <>
    <Title>이때어때</Title>
    <Box>
        {children}
    </Box>
    </>
  )
}

export default Container
